import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import { Link } from 'react-router-dom';
import { makeStyles } from '@material-ui/core';

const useStyles=makeStyles((theme)=>({
    dark:{
        backgroundColor:'black',
        color:'white'
    }
}))

export default function Navbar() {
    const classes = useStyles()
    return (
        <>
            <Box sx={{ flexGrow: 1 }}>
                <AppBar position="static" color="secondary">
                    <Toolbar>
                        <Typography
                            variant="h6"
                            component="div"
                            sx={{ flexGrow: 1 }}
                        >
                            News
                        </Typography>
                        <Link to="/Business">
                            <Button color="inherit" >business</Button>
                        </Link>
                        <Link to="/Entertainment">
                            <Button color="inherit" className={classes.dark} >entertainment</Button>
                        </Link>
                        <Link to="/General" >
                            <Button color="inherit" >general</Button>
                        </Link>
                        <Link to="/Health" >
                            <Button color="inherit" >health</Button>
                        </Link>
                        <Link to="/Science" >
                            <Button color="inherit" >science</Button>
                        </Link>
                        <Link to="/Sports" >
                            <Button color="inherit" >sports</Button>
                        </Link>
                        <Link to="/Technology" >
                            <Button color="inherit" >technology</Button>
                        </Link>
                    </Toolbar>
                </AppBar>
            </Box>
        </>
    );
}
